import React from 'react';
import Footer from '../components/Footer';
import Navbar from '../components/Navbar';


export default function MyOrders() {
  return (
    <>
    <div>
      <Navbar />
    </div>
    <div>
        <Footer />
    </div>
    </>
  );
}
